import React from 'react'

const Projectcard = ({image,url1,url2}) => {
  return (
    <div className="projectcard">
        <img src={image} alt="" />
        <a href={url1}><button className='button'>Click to view</button></a>
        <a href={url2}><button className='button'>Source code</button></a>
   </div>
  )
}

export default Projectcard
